import React from "react";
import classes from "./TriviaHeader.module.css";

function TriviaHeader(props) {
  return (
    <div className={classes.container}>
      <div className={classes.logo}>
        <h1>Trivia</h1>
      </div>
      <div>
        <button>Logout</button>
      </div>
    </div>
  );
}

export default TriviaHeader;
